import React,{useState,useEffect} from 'react';
import {Table} from 'react-bootstrap';

function Summary() {
  const [summary,setSummary] = useState([]);

  useEffect(()=>{
    fetchData();
  },[]);

  const fetchData = async() => {
    fetch('http://localhost:5000/getsummary')
      .then(response=>response.json())
      .then(data=>{
        console.log(data)
        setSummary(data)
      })
  }
  return (
    <div>
        <Table striped bordered hover>
          <tbody>

            <tr>
              <td>Profit/Loss</td>
              <td>{summary.pnl}</td>
            </tr>
            <tr>
              <td>NPV</td>
              <td>{summary.npv}</td>
            </tr>
            <tr>
              <td>Cash Deposited</td>
              <td>{summary.accountbalance}</td>
            </tr>
            <tr>
              <td>Margin Used</td>
              <td>{summary.marginused}</td>
            </tr>
            <tr>
              <td>Margin(%)</td>
              <td>{summary.marginlevel}</td>
            </tr>
            <tr>
              <td>Margin Free</td>
              <td>{summary.marginfree}</td>
            </tr>

          </tbody>
        </Table>
    </div>
  );
}

export default Summary;
